typedef int (*IOMethod)(void * p1, void * p2, void * p3,
                        void * p4, void * p5, void * p6 );

typedef int (*IOAsyncMethod)(unsigned int asyncRef[8],
                             void * p1, void * p2, void * p3,
                             void * p4, void * p5, void * p6 );

typedef int (*IOTrap)(void * p1, void * p2, void * p3,
                      void * p4, void * p5, void * p6 );


struct IOExternalMethod {
    IOService *        object;
    IOMethod        func;
    uint64_t        padding; // not sure why, but should be
    uint32_t        flags;
    uint64_t        count0;
    uint64_t        count1;
};

struct IOExternalAsyncMethod {
    IOService *        object;
    IOAsyncMethod    func;
    uint64_t        padding; // not sure why, but should be
    uint32_t        flags;
    uint64_t        count0;
    uint64_t        count1;
};

struct IOExternalTrap {
    IOService *        object;
    IOTrap        func;
};

enum {
    kIOUserNotifyMaxMessageSize = 64
};

enum {
    kIOUserNotifyOptionCanDrop = 0x1 /* Fail if queue is full, rather than infinitely queuing. */
};

